        <script src="index_files/json_LaikipiWardsOGRGeoJSONPolygon0.js"></script>
        <script src="index_files/json_laikipiajoined1.js"></script>
        <script>
        var highlightLayer;
        function highlightFeature(e) {
            highlightLayer = e.target;

            if (e.target.feature.geometry.type === 'LineString') {
              highlightLayer.setStyle({
                color: '#ffff00',
              });
            } else {
              highlightLayer.setStyle({
                fillColor: '#ffff00',
                fillOpacity: 1
              });
            }
            highlightLayer.openPopup();
        }
        L.ImageOverlay.include({
            getBounds: function () {
                return this._bounds;
            }
        });
        var map = L.map('map', {
            zoomControl:true, maxZoom:28, minZoom:1
        }).fitBounds([[-0.311737383897,35.6321147893],[0.895369880076,38.0000614986]]);
        var hash = new L.Hash(map);
        map.attributionControl.addAttribution('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a>');
        var feature_group = new L.featureGroup([]);
        var bounds_group = new L.featureGroup([]);
        var raster_group = new L.LayerGroup([]);
        var basemap0 = L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
            attribution: '&copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors,<a href="http://creativecommons.org/licenses/by-sa/2.0/">CC-BY-SA</a>',
            maxZoom: 28
        });
        basemap0.addTo(map);
        var layerOrder = new Array();
        function stackLayers() {
            for (index = 0; index < layerOrder.length; index++) {
                map.removeLayer(layerOrder[index]);
                map.addLayer(layerOrder[index]);
            }
        }
        function restackLayers() {
            for (index = 0; index < layerOrder.length; index++) {
                layerOrder[index].bringToFront();
            }
        }
        layerControl = L.control.layers({},{},{collapsed:false});
        function pop_LaikipiWardsOGRGeoJSONPolygon0(feature, layer) {
            layer.on({
                mouseout: function(e) {
                    layer.setStyle(doStyleLaikipiWardsOGRGeoJSONPolygon0(feature));

                    if (typeof layer.closePopup == 'function') {
                        layer.closePopup();
                    } else {
                        layer.eachLayer(function(feature){
                            feature.closePopup()
                        });
                    }
                },
                mouseover: highlightFeature,
            });
            var popupContent = '<table><tr><th scope="row">Ward: </th><td>' + (feature.properties['Ward_Name'] !== null ? Autolinker.link(String(feature.properties['Ward_Name'])) : '') + '</td></tr></table>';
            layer.bindPopup(popupContent);
        }

        function doStyleLaikipiWardsOGRGeoJSONPolygon0(feature) {
            return {
                weight: 0.26,
                color: '#000000',
                fillColor: '#fdbf6f',
                dashArray: '',
                lineCap: 'square',
                lineJoin: 'bevel',
                opacity: 0.24,
                fillOpacity: 0.24
            };
        }
        var json_LaikipiWardsOGRGeoJSONPolygon0JSON = new L.geoJson(json_LaikipiWardsOGRGeoJSONPolygon0, {
            onEachFeature: pop_LaikipiWardsOGRGeoJSONPolygon0,
            style: doStyleLaikipiWardsOGRGeoJSONPolygon0
        });
        layerOrder[layerOrder.length] = json_LaikipiWardsOGRGeoJSONPolygon0JSON;
        bounds_group.addLayer(json_LaikipiWardsOGRGeoJSONPolygon0JSON);
        feature_group.addLayer(json_LaikipiWardsOGRGeoJSONPolygon0JSON);
        function pop_laikipiajoined1(feature, layer) {
            layer.on({
                mouseout: function(e) {
                    layer.setStyle(doStylelaikipiajoined1(feature));

                    if (typeof layer.closePopup == 'function') {
                        layer.closePopup();
                    } else {
                        layer.eachLayer(function(feature){
                            feature.closePopup()
                        });
                    }
                },
                <!--mouseover: highlightFeature,--!>
            });
            var popupContent = '<table><tr><th scope="row">Name: </th><td>' + (feature.properties['Name'] !== null ? Autolinker.link(String(feature.properties['Name'])) : '') + '</td></tr><tr><th scope="row">Status: </th><td>' + (feature.properties['Title_Status'] !== null ? Autolinker.link(String(feature.properties['Title_Status'])) : '') + '</td></tr></table>';
            layer.bindPopup(popupContent);
        }

        function doStylelaikipiajoined1(feature) {
			switch (feature.properties.Title_Status) {
                case 'Not applied for Title':
                    return {
                    radius: '7.0',
                    fillColor: '#d7191c',
                    color: '#000000',
                    weight: 0.0,
                    opacity: 1.0,
                    dashArray: '',
                    fillOpacity: '1.0',
                };
                break;
                case 'Title issued':
                    return {
                    radius: '7.0',
                    fillColor: '#fdc980',
                    color: '#000000',
                    weight: 0.0,
                    opacity: 1.0,
                    dashArray: '',
                    fillOpacity: '1.0',
                };
                break;
                case 'Title not issued':
                    return {
                    radius: '7.0',
                    fillColor: '#b2df8a',
                    color: '#000000',
                    weight: 0.0,
                    opacity: 1.0,
                    dashArray: '',
                    fillOpacity: '1.0',
                };
                break;
                default:
                    return {
                    radius: '7.0',
                    fillColor: '#1a9641',
                    color: '#000000',
                    weight: 0.0,
                    opacity: 1.0,
                    dashArray: '',
                    fillOpacity: '1.0',
                };
                break;
            }
        }
        var json_laikipiajoined1JSON = new L.geoJson(json_laikipiajoined1, {
            onEachFeature: pop_laikipiajoined1,
            pointToLayer: function (feature, latlng) {
                return L.circleMarker(latlng, doStylelaikipiajoined1(feature))
            }
        });
        var cluster_grouplaikipiajoined1JSON = new L.MarkerClusterGroup({showCoverageOnHover: false});
        cluster_grouplaikipiajoined1JSON.addLayer(json_laikipiajoined1JSON);

        layerOrder[layerOrder.length] = cluster_grouplaikipiajoined1JSON;

        bounds_group.addLayer(json_laikipiajoined1JSON);
        cluster_grouplaikipiajoined1JSON.addTo(map);
        raster_group.addTo(map);
        feature_group.addTo(map);
        stackLayers();
        map.on('overlayadd', restackLayers);
        </script>
